const FeedWorkspaceCard = ({workspace}) => {
    return (
        // <Link to={`/workspace/${workspace._id}`} className="feed-card">
        <Link to={"jk"} className="feed-card">
            <img src="https://via.placeholder.com/1000" />
            <p>Workspace 2</p>
